import ReactDOM from 'react-dom/client'; // Correct import for React 18+
import App from './App';
import './index.css'; // Optional: If you have global styles

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
